This makes various evaluate functions do type-checking on the arguments.
result = await page.evaluate((n: number, s: string) => n + s, foo, bar)
result = await arrayHandle.evaluate((self: string[], n: number, s: string) => n + s, foo, bar)

// Both of the calls enforce the following types:
// foo: number | JSHandle
// bar: string | JSHandle
// result: string

Unfortunately, I wasn't able to make perfect forwarding work, because ...args tuple is not inferred as extends any[]. This is mitigated by ...args as any in the forwarding calls.

setup .npmignore;
index.js selecting a browser;
minor package.json tweaks;
example script which works against npm pack'ed module.

Background
related to #606
How has this been tested?

Clone the repository including this patch
Create a sample project
Install local module as npm package with npm install -S /absolute-path/to/playwright
package.json should be like this:
"dependencies": {
    "playwright-core": "file:/path/to/playwright"
}

Create a main.js with following code:
const devices = require("playwright-core").devices

const deviceMap = new Map();
for (const device of devices) {
  deviceMap.set(device.name, device);
}

for (const name of deviceMap.keys()) {
  if (name.endsWith(" landscape")) continue;
  const landscapeName = `${name} landscape`;
  if (!deviceMap.has(landscapeName)) {
    const landscapeDevice = deviceMap.get(name);
    const {width, height} = landscapeDevice.viewport;
    landscapeDevice.name = landscapeName;
    landscapeDevice.viewport.width = height;
    landscapeDevice.viewport.height = width;
    console.log(`Missing device for "${landscapeName}", expected: ${JSON.stringify(landscapeDevice,     null, 2)}`);
  }
}

It should not output log.

